for (var x=0; x < bpm_package.children.length; x++){
	tmp03 = bpm_package.children[x];
	arrNX.push(tmp03.properties.name);
}
for (var i=0; i < folderNode.children.length; i++){
	tmp = folderNode.children[i];
	if ( tmp.isContainer ) {
		for (var j=0; j < tmp.children.length; j++){
			tmp02 = tmp.children[j];
			if( arrNX.indexOf(tmp02.properties.name) == -1 ){
				bpm_package.addNode( tmp02 );
			}
		}
	} else {
		if( arrNX.indexOf(tmp.properties.name) == -1 ){
			bpm_package.addNode( tmp );
		}
	}
}

